import React from "react";
import "./Nav.css";

const Nav = () => {
  return (
    <header>
      <div className="container">
        <div className="navbar">
          <h1 className="logo">
            <span>logo</span>
          </h1>
          <nav>
            <ul>
              <li>
                <a href="/">Projects</a>
              </li>
              <li>
                <a href="/">Contact</a>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    </header>
  );
};

export default Nav;
